import styled from "styled-components";

export const Header = styled.div`
  width: 1440px;
  height: 128px;
  border: 1px solid #c2c2c2;
  border-radius: 12px;
  margin: auto;
  border-radius: 12px 12px 0px 0px;

  .iconArea {
    width: 283px;
  }
`;

export const Container = styled.div`
  width: 1440px;
  height: 1024px;
  border: 1px solid #c2c2c2;
  border-radius: 12px 0px 0px 0px;
  margin: auto;
`;
